def text_num_exchanger(value):
    if type(value) == int:
        if value == 1:
            return "아주 빠르게"
        elif value == 3:
            return "빠르게"
        elif value == 10:
            return "천천히"
        elif value == 14:
            return "아주 천천히"

    else:
        # 아주 빠르게 1
        # 빠르게 3
        # 천천히 10
        # 아주 천천히 14
        if value=="아주 빠르게":
            return 1
        elif value == "빠르게":
            return 3
        elif value == "천천히":
            return 10
        elif value == "아주 천천히":
            return 14
    
def hex_to_rgb(hex):
    r = int(hex[1:3], 16)
    g = int(hex[3:5], 16)
    b = int(hex[5:7], 16)
    return r,g,b

def percentage_to_float(percent):
    # percent (0~100) mapping to (1.0 ~ 0.0)
    return 1.0 - percent/100

