    def save(self):
        
        ###rotate_scan###
        if self.rs_switch_press.isChecked():
            settings.setValue("SPIN/click_state", 0)
        else: # release.isChecked()
            settings.setValue("SPIN/click_state", 1)

        settings.setValue("SPIN/rotate_wait", self.rs_rotate_wait.value()- 1)
        settings.setValue("SPIN/move_wait", text_num_exchanger(self.rs_move_wait.currentText()))

        settings.setValue("SPIN/rotate_time", self.rs_rotate_time.value())
        settings.setValue("SPIN/move_time", self.rs_move_time.value())
       
        # print(self.rs_color.palette().button().color().name()) # hex include '#'
        r,g,b = hex_to_rgb(self.rs_color.palette().button().color().name())
        settings.setValue("SPIN/line_color_r", r)
        settings.setValue("SPIN/line_color_g", g)
        settings.setValue("SPIN/line_color_b", b)

        r,g,b = hex_to_rgb(self.rs_color_d.palette().button().color().name())
        settings.setValue("SPIN/d_line_color_r", r)
        settings.setValue("SPIN/d_line_color_g", g)
        settings.setValue("SPIN/d_line_color_b", b)

        settings.setValue("SPIN/guide_line_thickness", self.rs_guideline_thickness.value())
        settings.setValue("SPIN/line_opacity",percentage_to_float(float(self.rs_line_opacity.value())))

        settings.setValue("SPIN/target_key", self.rs_input_key.currentText())
        settings.setValue("SPIN/change_key", self.rs_change_key.currentText())
        settings.setValue("SPIN/end_key", self.rs_exit_key.currentText())
        
        ###xy_scan###
        if self.xys_switch_press.isChecked():
            settings.setValue("LINE/click_state", 0)
        else: # release.isChecked()
            settings.setValue("LINE/click_state", 1)

        settings.setValue("LINE/move_wait", text_num_exchanger(self.xys_move_wait.currentText()))

        settings.setValue("LINE/x_time", self.xys_x_time.value())
        settings.setValue("LINE/y_time", self.xys_y_time.value())
       
        r,g,b = hex_to_rgb(self.xys_color.palette().button().color().name())
        settings.setValue("LINE/line_color_r", r)
        settings.setValue("LINE/line_color_g", g)
        settings.setValue("LINE/line_color_b", b)

        r,g,b = hex_to_rgb(self.xys_color_d.palette().button().color().name())
        settings.setValue("LINE/d_line_color_r", r)
        settings.setValue("LINE/d_line_color_g", g)
        settings.setValue("LINE/d_line_color_b", b)

        settings.setValue("LINE/guide_line_thickness", self.xys_guideline_thickness.value())
        settings.setValue("LINE/line_opacity",percentage_to_float(float(self.xys_line_opacity.value())))

        settings.setValue("LINE/target_key", self.xys_input_key.currentText())
        settings.setValue("LINE/change_key", self.xys_change_key.currentText())
        settings.setValue("LINE/end_key", self.xys_exit_key.currentText())

    
    def return_default(self):
        
        ###rotate_scan###
        if settings.value("SPIN/click_state") == "0":
             #라디오 버튼 값 조정
            self.rs_switch_press.setChecked(True)
