        r = int(settings.value("LINE/d_line_color_r"))
        g = int(settings.value("LINE/d_line_color_g"))
        b = int(settings.value("LINE/d_line_color_b"))
        color = QtGui.QColor(r, g, b)
        self.xys_color_d.setStyleSheet('background-color: {}'.format(color.name()))

        self.xys_guideline_thickness.setValue(int(settings.value("LINE/guide_line_thickness")))
